import React from 'react';
import { Helmet } from 'react-helmet-async';
import { Bot, MessageSquare, Workflow, Brain, Sparkles, TrendingUp } from 'lucide-react';
import ServiceHero from '../../components/ServiceHero';
import ServiceFeatures from '../../components/ServiceFeatures';
import ServiceContact from '../../components/ServiceContact';
import useScrollAnimation from '../../hooks/useScrollAnimation';

const AIAutomations = () => {
    useScrollAnimation();

    const features = [
        {
            icon: Bot,
            title: 'AI Agents',
            description: 'Intelligent agents that automate complex workflows, make decisions, and learn from interactions.'
        },
        {
            icon: MessageSquare,
            title: 'Chatbots & Virtual Assistants',
            description: 'Conversational AI for customer support, sales, and internal operations with natural language processing.'
        },
        {
            icon: Workflow,
            title: 'Process Automation',
            description: 'Automate repetitive tasks, data entry, and business processes with intelligent automation.'
        },
        {
            icon: Brain,
            title: 'Machine Learning',
            description: 'Custom ML models for predictions, recommendations, and data-driven decision making.'
        },
        {
            icon: Sparkles,
            title: 'Natural Language Processing',
            description: 'Text analysis, sentiment detection, and language understanding for better customer insights.'
        },
        {
            icon: TrendingUp,
            title: 'Predictive Analytics',
            description: 'AI-powered forecasting and trend analysis to optimize business strategies.'
        }
    ];

    const useCases = [
        {
            title: 'Customer Support',
            description: '24/7 AI chatbots that handle inquiries, resolve issues, and escalate to humans when needed.',
            impact: '70% reduction in support tickets'
        },
        {
            title: 'Sales Automation',
            description: 'AI agents that qualify leads, schedule meetings, and provide personalized recommendations.',
            impact: '45% increase in conversion'
        },
        {
            title: 'Data Processing',
            description: 'Automated data extraction, validation, and entry from documents and emails.',
            impact: '90% time savings'
        },
        {
            title: 'Content Generation',
            description: 'AI-powered content creation for marketing, social media, and product descriptions.',
            impact: '5x faster content production'
        }
    ];

    return (
        <div className="pt-20">
            <Helmet>
                <title>AI Automation Services | AI Agents & Bots | Enginerds</title>
                <meta
                    name="description"
                    content="AI automation solutions with intelligent agents and chatbots. Streamline operations and enhance customer experience with AI technology."
                />
                <meta
                    name="keywords"
                    content="AI automation, chatbots, AI agents, machine learning, process automation, NLP"
                />
                <link rel="canonical" href="https://www.enginerds.in/services/ai-automations" />
            </Helmet>

            <ServiceHero
                title="AI Automations"
                subtitle="Artificial Intelligence"
                description="Harness the power of AI to automate workflows, enhance customer experiences, and unlock new efficiencies. We build intelligent agents and bots that work 24/7 to drive your business forward."
                backgroundImage="https://images.unsplash.com/photo-1677442136019-21780ecad995?auto=format&fit=crop&w=2000&q=80"
                ctaText="Automate with AI"
                ctaLink="#contact"
            />

            <ServiceFeatures
                title="AI Capabilities"
                subtitle="What We Automate"
                features={features}
            />

            {/* Use Cases */}
            <section className="py-20 bg-slate-50">
                <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
                    <div className="text-center mb-12 scroll-animate">
                        <p className="text-xs font-semibold tracking-[0.35em] uppercase text-primary-500 mb-4">
                            Use Cases
                        </p>
                        <h2 className="text-4xl sm:text-5xl font-bold text-gray-900 mb-4">
                            Real-World Applications
                        </h2>
                        <p className="text-lg text-gray-600 max-w-3xl mx-auto">
                            See how AI automation transforms businesses across industries.
                        </p>
                    </div>

                    <div className="grid gap-8 md:grid-cols-2 scroll-animate">
                        {useCases.map((useCase, index) => (
                            <div
                                key={index}
                                className="bg-white rounded-3xl p-8 shadow-[0_24px_55px_-35px_rgba(15,23,42,0.55)] border border-slate-100 transition-all duration-300 hover:-translate-y-2 hover:shadow-[0_38px_80px_-35px_rgba(236,72,153,0.65)] hover:border-primary-200"
                            >
                                <h3 className="text-2xl font-bold text-gray-900 mb-3">{useCase.title}</h3>
                                <p className="text-gray-600 mb-4">{useCase.description}</p>
                                <div className="inline-flex items-center px-4 py-2 rounded-full bg-primary-50 text-primary-700 font-semibold text-sm">
                                    {useCase.impact}
                                </div>
                            </div>
                        ))}
                    </div>
                </div>
            </section>

            {/* Technology Stack */}
            <section className="py-20 bg-white">
                <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
                    <div className="text-center mb-12 scroll-animate">
                        <p className="text-xs font-semibold tracking-[0.35em] uppercase text-primary-500 mb-4">
                            AI Technology
                        </p>
                        <h2 className="text-4xl sm:text-5xl font-bold text-gray-900">
                            Powered by Leading AI Platforms
                        </h2>
                    </div>

                    <div className="grid gap-6 md:grid-cols-3 lg:grid-cols-4 scroll-animate">
                        {[
                            'OpenAI GPT',
                            'Google Gemini',
                            'Anthropic Claude',
                            'TensorFlow',
                            'PyTorch',
                            'LangChain',
                            'Hugging Face',
                            'Azure AI'
                        ].map((tech, index) => (
                            <div
                                key={index}
                                className="bg-slate-50 rounded-2xl p-6 text-center border border-slate-100 hover:border-primary-200 transition-colors"
                            >
                                <span className="text-lg font-semibold text-gray-900">{tech}</span>
                            </div>
                        ))}
                    </div>
                </div>
            </section>

            {/* Benefits */}
            <section className="py-20 bg-slate-50">
                <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
                    <div className="text-center mb-12 scroll-animate">
                        <h2 className="text-4xl sm:text-5xl font-bold text-gray-900">
                            Why AI Automation?
                        </h2>
                    </div>

                    <div className="grid gap-8 md:grid-cols-3 scroll-animate">
                        {[
                            { stat: '24/7', label: 'Always Available', description: 'AI never sleeps or takes breaks' },
                            { stat: '10x', label: 'Faster Processing', description: 'Handle thousands of tasks simultaneously' },
                            { stat: '95%', label: 'Accuracy Rate', description: 'Consistent quality without human error' }
                        ].map((item, index) => (
                            <div key={index} className="text-center">
                                <div className="text-6xl font-bold text-primary-500 mb-2">{item.stat}</div>
                                <div className="text-xl font-semibold text-gray-900 mb-2">{item.label}</div>
                                <p className="text-gray-600">{item.description}</p>
                            </div>
                        ))}
                    </div>
                </div>
            </section>

            <ServiceContact serviceName="AI Automations" />
        </div>
    );
};

export default AIAutomations;
